export default (function(a,b,c,d,e){return {data:{t1J9yEzDOA:{data:{id:50,attributes:{imdbId:"tt0118548",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNDFlNTZmOGYtYmE0ZC00OTE4LWI5YzctNmZmZDU3M2ZiMmI4XkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"},{Source:"Rotten Tomatoes",Value:"56%"},{Source:"Metacritic",Value:"52\u002F100"}],item_lang:{data:{id:713,attributes:{title:d,plot:"Inspired by David Baldacci's novel, and the ruthlessness of people in power. President Alan Richmond believes that everything he does is beyond reproach, including an affair or two. That leads to murder and everyone around him is involved. There is only one witness, a thief named Luther Whitney. They are sure he'll talk, but when? The Secret Service is determined to keep him quiet, but catching a thief isn't always easy.",slug:"absolute-power"}}},books:{data:[{id:1943,attributes:{title:d,description:"Set at the heart of political power in Washington DC, Absolute Power was the book which launched David Baldacci's career as a worldwide bestseller of thrilling fiction. The movie, starring Clint Eastwood, was a major box office success across the world.In a heavily guarded mansion in the Virginian countryside, professional burglar and break-in artist, Luther Whitney, is trapped behind a one-way mirror. What he witnesses destroys his faith not only in justice, but all he holds dear. What follows is an unthinkable abuse of power and a criminal conspiracy, as a breathtaking cover-up is set in motion by those appointed to work for one of the most important people in the world - the President of the United States.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_RkAwQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2016-10-06",publisher:e,subtitle:a}},{id:1944,attributes:{title:d,description:"When burglar Luther Whitney breaks into a Virginia mansion, he witnesses a brutal crime involving the president -- a man who believes he can get away with anything -- and now, Luther may be the only one who can stop him in this #1 New York Times bestselling thriller. In a heavily guarded mansion in the Virginia countryside, professional burglar and break-in artist Luther Whitney is trapped behind a two-way mirror. What he witnesses destroys his faith not only in justice, but in all he holds dear. What follows is an unthinkable abuse of power and criminal conspiracy, as a breathtaking cover-up is set in motion by those appointed to work for one of the most important people in the world -- the President of the United States.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cRFmAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2001-06-15",publisher:"Hachette UK",subtitle:a}},{id:1945,attributes:{title:"Saving faith ; Absolute power",description:a,thumbnail:a,authors:[b],firstBook:c,published:"2009-01-01",publisher:a,subtitle:a}},{id:1946,attributes:{title:"Absolute Power - Der Pr√§sident",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Qwr1ugAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2012-01-01",publisher:a,subtitle:a}},{id:1947,attributes:{title:"David Baldacci Omnibus",description:"This title contains two novels by David Baldacci - 'Absolute Power' and 'Total Control'.",thumbnail:a,authors:[b],firstBook:c,published:"2006-09-01",publisher:e,subtitle:"Absolute Power; Total Control"}}]}}},meta:{}}},prerenderedAt:1680940906813}}("","David Baldacci",null,"Absolute Power","Pan"))